import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Base from './pages/Base';
import Home from './pages/Home';
import Directories from './pages/Directories';
import Chat from './pages/Chat';
import { UserContext } from './context/UserContext';
import logo from './images/OatmealaLogoi (1).png';
import './styles/App.css';

// Protected route component that checks authentication and redirects if necessary
const ProtectedRoute = ({ component: Component }) => {
  const token = localStorage.getItem('token');
  const isAuthenticated = !!token;

  console.log('ProtectedRoute - Auth check:', isAuthenticated ? 'Authenticated' : 'Not authenticated');

  // If not authenticated, redirect to login
  if (!isAuthenticated) {
    console.log('ProtectedRoute - Redirecting to login');
    return <Navigate to="/login" />;
  }

  // Render the protected component
  return <Component />;
};

function App() {
  const [user, setUser] = useState({ username: localStorage.getItem('username') || "Guest" });

  useEffect(() => {
    // Example of setting user after login
    const token = localStorage.getItem('token');
    const storedUsername = localStorage.getItem('username');

    if (token && storedUsername) {
      setUser({ username: storedUsername });
    }
  }, []);

  return (
    <UserContext.Provider value={{ user, setUser }}>
      <AuthProvider>
        <Router>
          <div className="app">
            <header className="main-header">
              <nav>
                <div className="logo">
                  <Link to="/">
                    <img src={logo} alt="Oatmeal AI Logo" />
                    <div className="logo-text-container">
                      <span className="logo-text">Oatmeal AI</span>
                    </div>
                  </Link>
                </div>
                <div className="nav-right">
                  <Link to="/" className="nav-link">Home</Link>
                  <Link to="/chat" className="nav-link">Chat</Link>
                  <div className="profile-icon">
                    <Link to="/profile" title={user.username || "Profile"}>
                      {user.username ? user.username.charAt(0).toUpperCase() : "G"}
                    </Link>
                  </div>
                </div>
              </nav>
            </header>

            <Routes>
              <Route path="/" element={<Base />} />
              <Route path="/login" element={<Login />} />
              <Route path="/signup" element={<Signup />} />
              <Route path="/home" element={<Home />} />
              <Route path="/directories" element={<Directories />} />
              <Route path="/chat" element={<Chat />} />
              {/* Add your other routes here */}
            </Routes>
          </div>
        </Router>
      </AuthProvider>
    </UserContext.Provider>
  );
}

export default App;
